Explanation for Problem 5:   Let $O$ be the center of the octagon. Then $O$ is the center of a square of side length $12\sqrt{2}$, and the area of the octagon is the area of the square minus the area of the four right triangles, each with legs of length 6. Thus, the area of the octagon is $12\sqrt{2}\cdot12\sqrt{2}-4\cdot\frac{1}{2}\cdot6\cdot6=144\cdot2-72=216$. The area of trapezoid $BCDE$ is half the area of the octagon, or $\boxed{108}$ square centimeters.

