draw( dir(90+x)--dir(90+5*45+x) );
draw( dir(90+x)--dir(90+4*45+x)--dir(90+5*45+x),dashed );
label("$O$", dir(90+45+x)+dir(90+4*45+x), S);
[/asy]

The answer is therefore 108 square centimeters.

