\[|x + y - 1| = \max(x + y - 1, 1 - x - y).\]If $x \ge 0,$ then $|x| = x,$ so $||x| - x| = |x - x| = 0.$  If $x < 0,$ then $|x| = -x,$ so $||x| - x| = |-x - x| = 2x.$  Thus,
\[||x| - x| = \max(0, -2x).\]If $x \ge 1,$ then $|x - 1| = x - 1,$ so $||x - 1| + x - 1| = |x - 1 + x - 1| = 2x - 2.$  If $x < 1,$ then $|x - 1| = 1 - x,$ so $||x - 1| + x - 1| = |1 - x + x - 1| = 0.$  Thus,
\[||x - 1| + x - 1| = \max(0, 2x - 2).\]Thus, the given equation becomes
\[\max(x + y - 1, 1 - x - y) + \max(0, -2x) + \max(0, 2x - 2) = 0.\]If $x + y - 1 \ge 0,$ then $1 - x - y < 0,$ so
\[x + y - 1 + \max(0, -2x) + \max(0, 2x - 2) = 0.\]If $x + y - 1 < 0,$ then $1 - x - y \ge 0,$ so
\[1 - x - y + \max(0, -2x) + \max(0, 2x - 2) = 0.\]If $x \ge 1,$ then $2x - 2 \ge 0,$ so
\[1 - x - y + \max(0, -2x) + 2x - 2 = 0.\]If $x < 1,$ then $2x - 2 < 0,$ so
\[1 - x - y + \max(0, -2x) = 0.\]If $x \ge 0,$ then $-2x \le 0,$ so
\[1 - x - y + 0 = 0.\]If $x < 0,$ then $-2x \ge 0,$ so
\[1 - x - y + (-2x) = 0.\]Thus, we have the following cases:

1. $x + y - 1 \ge 0,$ $x \ge 1,$ and $x \ge 0.$  Then
\[x + y - 1 + 0 + 2x - 2 = 0.\]This simplifies to $3x + y - 3 = 0.$

2. $x + y - 1 \ge 0,$ $x \ge 1,$ and $x < 0.$  This case is not possible.

3. $x + y - 1 \ge 0,$ $x < 1,$ and $x \ge 0.$  Then
\[x + y - 1 + 0 + 0 = 0.\]This simplifies to $x + y - 1 = 0.$

