\[1 - x - y + 0 + 0 = 0.\]This simplifies to $1 - x - y = 0.$

8. $x + y - 1 < 0,$ $x < 1,$ and $x < 0.$  Then
\[1 - x - y + (-2x) = 0.\]This simplifies to $1 - x - y - 2x = 0,$ or $-3x - y + 1 = 0.$

