Explanation for Problem 5:   Let $g$ be the weight of one green ball and $r$ be the weight of one red ball. We have the following system of equations:

\begin{align*}
5g + 2r &= 10, \\
g + 4r &= 7.
\end{align*}

We can solve this system of equations by multiplying the second equation by $5$ and then subtracting the first equation from the result:

\begin{align*}
5(g + 4r) - (5g + 2r) &= 5(7) - 10, \\
20r - 2r &= 35 - 10, \\
18r &= 25, \\
r &= \frac{25}{18}.
\end{align*}

Now we can substitute this value of $r$ back into the second equation to find the value of $g$:

\begin{align*}
g + 4\left(\frac{25}{18}\right) &= 7, \\
g &= 7 - \frac{100}{18} = \frac{26}{18}.
\end{align*}

Now we can find the weight of $8$ red and $8$ green balls together:

\begin{align*}
8r + 8g &= 8\left(\frac{25}{18}\right) + 8\left(\frac{26}{18}\right) \\
&= 8\left(\frac{25 + 26}{18}\right) \\
&= 8\left(\frac{51}{18}\right) \\
&= \boxed{17}.
\end{align*}

The answer is therefore 17 pounds.

