\begin{align*}
4 \sin x \sin (60^\circ - x) \sin (60^\circ + x) &= 2 \sin x [\cos(x - (60^\circ - x)) - \cos(x + (60^\circ - x))] \sin (60^\circ + x) \\
&= 2 \sin x [\cos(2x - 60^\circ) - \cos(60^\circ)] \sin (60^\circ + x)
\end{align*}

Now, we can apply the product-to-sum identity again:

\begin{align*}
2 \sin x [\cos(2x - 60^\circ) - \cos(60^\circ)] \sin (60^\circ + x) &= \sin x [\cos((2x - 60^\circ) - (60^\circ + x)) - \cos((2x - 60^\circ) + (60^\circ + x))] \\
&= \sin x [\cos(x - 120^\circ) - \cos(3x)] \\
\end{align*}

