\[DC_1^2 = AD^2 + AC_1^2 - 2 \cdot AD \cdot AC_1 \cos 140^\circ.\]By the Law of Cosines on triangle $ADC_2,$
\[DC_2^2 = AD^2 + AC_2^2 - 2 \cdot AD \cdot AC_2 \cos 140^\circ.\]Hence, $DC_1 = DC_2.$

