Now, let $P = (x,x,1 - x).$  Then
\[OP^2 = x^2 + x^2 + (1 - x)^2 = 3x^2 - 2x + 1\]and
\[PQ^2 = (x - 1)^2 + x^2 + (1 - x)^2 = 2x^2 - 2x + 1.\]Thus,
\[d^2 = OP^2 + PQ^2 = 5x^2 - 4x + 2.\]By AM-GM,
\[5x^2 - 4x + 2 = x^2 + 4x^2 - 4x + 2 \ge 2 \sqrt{x^2 (4x^2 - 4x + 2)}.\]Since $x > 0,$ $5x^2 - 4x + 2 > 0,$ so
\[2 \sqrt{x^2 (4x^2 - 4x + 2)} \ge 1.\]Then
\[x^2 (4x^2 - 4x + 2) \ge \frac{1}{4},\]which simplifies to
\[16x^4 - 16x^3 + 8x^2 - x^2 + x \ge 0.\]This factors as $x(16x^3 - 15x^2 + 7x - 1) \ge 0.$  Since $x > 0,$
\[16x^3 - 15x^2 + 7x - 1 \ge 0.\]By the Integer Root Theorem, the only possible rational roots are 1.  Checking, we find that $x = 1$ is not a root, so the inequality holds for all $x > 0.$

Equality occurs when $x = \frac{1}{3},$ so $d^2 = \boxed{\frac{5}{3}}.$

